                  <p><span data-contrast="auto">The OU Impact Accelerator identifies and advances promising Jewish startup nonprofits through education, mentorship, collaboration, and a grant.</span></p>
                  <p>This year, we will be selecting ventures tackling the issue of <strong>affordability and economic empowerment</strong>. This includes (but is not limited to) ventures that address underlying issues regarding food and shelter instability, career assistance, high cost of tuition, tutoring, or special needs education, help to create financial literacy, financial assistance and coaching, and anything else that can ease the burden of the high cost of Jewish life.</p>
                  <p>You can download a document with all of the questions <a href="https://accelerator.ou.org/content/uploads/2023/04/Selection_Application-Questions_Cohort-V.docx" target="_blank" rel="noopener">here.</a> We recommend you work on the questions in a separate document and return to “copy and paste” all the answers once final. <strong><span class="TextRun SCXW152220355 BCX0" lang="EN-US" xml:lang="EN-US" data-contrast="auto"><span class="NormalTextRun SCXW152220355 BCX0">You must complete the answers in the online form (below) to be considered for the cohort.</span></span></strong><span class="EOP SCXW152220355 BCX0" data-ccp-props="{&quot;134233117&quot;:false,&quot;134233118&quot;:false,&quot;201341983&quot;:0,&quot;335551550&quot;:1,&quot;335551620&quot;:1,&quot;335559685&quot;:0,&quot;335559737&quot;:0,&quot;335559738&quot;:0,&quot;335559739&quot;:160,&quot;335559740&quot;:259}">&nbsp;</span></p>
                  <p>There is a ‘save and continue’ option for you to save your work.</p>
                  <div id="gfield_description_40_155" class="gfield_description">The Impact Accelerator educational program will run from August 2023 to April 2024. You will be benefit from educational workshops, mentorship and coaching, and cohort building activities. There will be both synchronous and asynchronous learning.</div>
                  <div></div>
                  <div class="gfield_description"><strong>NYC In-person dates: </strong>October 17-18, 2023; January 9-10, 2024; April 2-3, 2024</div>
                  <div></div>
                  <div class="gfield_description"><strong>Virtual Times:</strong></div>
                  <div class="gfield_description">There will be virtual programming on September 13, 2023; November 1, 2023; December 6, 2023; February 7, 2024; and March 6, 2024, from 12-1:30PM ET. Additionally, there will be monthly half hour check-ins with the Impact Accelerator team and hour meetings with mentors. Please ensure that you will be able to commit to these dates and times.</div>
                  <p>If you have any issues or questions, please reach out to Abigail, rochlina@ou.org.</p>
